function help(){
	$("#lastthinglog").html("help");
$("#log").append("help");
	$("#ayuda").addClass("ayudaconsola");
	$("#ayuda").html("<center><strong>Ayuda de la consola</strong><br><p>Ayuda de la consola</p></center>");
	}
	function help_destroy(){
		$("#lastthinglog").html("help_destroy");
$("#log").append("help_destroy");
	$("#ayuda").removeClass("ayudaconsola");
	$("#ayuda").html("");
	}
